import React from 'react'
import CardItem from './CardItem';

function Cards() {
    return (
        <div className = "Cards">
            <h1>Descriptions </h1>
            <div className = "cards__container">
                <div className = "cards__wrapper">
                    <ul className = "cards___item"><CardItem></CardItem></ul>
                </div>
            </div>
        </div>
    )
}

export default Cards;
